import React from 'react';

import Logo from '../../assets/img/eshop/logo.png';

const Footer = () => {
  return (
    <div className="footer-wrapper">
        <div className="container">
            <div className="inner_footer_wrapper">
                <div className="row">
                    <div className="col-md-4">

                    </div>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Footer;
